var input = document.getElementById('input');
var output = document.getElementById('output');
var exactCharacters = document.getElementById('exact-characters');
var longerCharacters = document.getElementById('longer-characters');
var exactWords = document.getElementById('exact-words');
var longerWords = document.getElementById('longer-words');

input.oninput = refreshResults;

function refreshResults() {
    var matches = {exactCharacters: [], longerCharacters: [], exactWords: [], longerWords: []};

    if (!input.value.match(/^[a-z\?\.\^\$]+/)) {
        exactCharacters.innerHTML = '';
        longerCharacters.innerHTML = '';
        exactWords.innerHTML = '';
        longerWords.innerHTML = '';
        return;
    }

    var loosePattern = RegExp('^'+input.value.replace(/\?/g, '.'));
    var exactPattern = RegExp('^'+input.value.replace(/\?/g, '.')+'$');

    for (var code in zhengmaDictionary) {
        for (var i = 0; i < zhengmaDictionary[code].length; i++) {
            if (zhengmaDictionary[code][i].length == 1) {
                if (code.match(exactPattern)) {
                    matches.exactCharacters.push(zhengmaDictionary[code][i]);
                } else if (code.match(loosePattern)) {
                    matches.longerCharacters.push(zhengmaDictionary[code][i]);
                }
            } else {
                if (code.match(exactPattern)) {
                    matches.exactWords.push(zhengmaDictionary[code][i]);
                } else if (code.match(loosePattern)) {
                    matches.longerWords.push(zhengmaDictionary[code][i]);
                }
            }
        }
    }

    exactCharacters.innerHTML = matches.exactCharacters.filter(unique).slice(0,50).map(generateResultHtml).join('\n');
    longerCharacters.innerHTML = matches.longerCharacters.filter(unique).slice(0,50).map(generateResultHtml).join('\n');
    exactWords.innerHTML = matches.exactWords.filter(unique).slice(0,50).map(generateResultHtml).join('\n');
    longerWords.innerHTML = matches.longerWords.filter(unique).slice(0,50).map(generateResultHtml).join('\n');

}

function generateResultHtml(text) {
    return '<ruby>'+text+'<rt>'+zhengmaDictionary[text].join('/')+'</rt></ruby><br>';
}

function unique(value, index, self) {
    return self.indexOf(value) === index;
}
